matplotlib.lib.matplotlib._constrained_l:
def check_no_collapsed_axes(layoutgrids, fig):
    """
    Check that no Axes have collapsed to zero size.
    """
    for sfig in fig.subfigs:
        ok = check_no_collapsed_axes(layoutgrids, sfig)
        if not ok:
            return False
    for ax in fig.axes:
        gs = ax.get_gridspec()
        if gs in layoutgrids:  # also implies gs is not None.
            lg = layoutgrids[gs]
            for i in range(gs.nrows):
                for j in range(gs.ncols):
                    bb = lg.get_inner_bbox(i, j)
                    if bb.width <= 0 or bb.height <= 0:
                        return False
    return True

matplotlib.lib.matplotlib.axes._base.get:
def get_gridspec(self):
    """Return the `.GridSpec` associated with the subplot, or None."""
    return self._subplotspec.get_gridspec() if self._subplotspec else None

matplotlib.lib.matplotlib.transforms.wid:
@property
def width(self):
    """The (signed) width of the bounding box."""
    points = self.get_points()
    return points[1, 0] - points[0, 0]

matplotlib.lib.matplotlib.transforms.hei:
@property
def height(self):
    """The (signed) height of the bounding box."""
    points = self.get_points()
    return points[1, 1] - points[0, 1]
